import React from 'react';
import {Avatar, Card} from 'antd';

const Profile = () => {

    return (
        <Card
        actions={
            [
                <div key = "twit"></div>
            ]

        }>

            <Card.Meta
                avatar={<Avatar>AF</Avatar>}
                title="AppleFarm"
            />

        </Card>
    );
}
export default Profile;
